function: "This is a foot which, once printed, will accept a nearly 40mm square section of 10mm thick self adhesive foam.  The feet of the Darwin frame (the smooth vertical rods) fit loosly in the top of the foot.  The hole is there to keep the foot from sliding away from the centre.\r\n\r\nIt reduces the vibration passed through to a hard surface - useful if your Darwin sits on a table."
